INSERT INTO `posts` (`id`, `title`, `slug`, `category_id`, `content`, `image`, `created_at`, `updated_at`, `views`, `deleted_at`) VALUES
(1, 'percobaan', 'percobaan', 2, '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', 'posts/jQ1SfNad93MM52rgXKbDLw4pz2X0VAdhevyAQiR8.png', '2025-06-05 03:01:51', '2025-06-05 11:40:20', 12, NULL),
(2, 'Bitcoin and Ethereum Funding Rates Swinging Two Different Directions to End the Week', 'bitcoin-and-ethereum-funding-rates-swinging-two-different-directions-to-end-the-week', 7, '<p> Sebagian besar pedagang Bitcoin telah mengambil posisi beli pada harga sejak penurunan kemarin mencapai titik terendah, dan telah memperoleh sedikit keuntungan. Sementara itu, pedagang Ethereum telah beralih dari posisi beli menjadi posisi jual berdasarkan apa pun yang telah dilakukan harga aset baru-baru ini.</p><p>Nilai tukar pendanaan bursa selalu rentan untuk dilikuidasi ketika berayun dari satu ekstrem ke ekstrem lainnya. Titik masuk terbaik biasanya adalah ketika pedagang lain bertaruh melawan koin, dan titik keluar terbaik adalah ketika yang lain sangat optimis.</p><p>&nbsp;</p><p><a href=\"https://app.santiment.net/s/57hUcxwH?utm_source=sanbase&amp;utm_medium=post&amp;utm_campaign=sanbase_btc_eth_funding_rates_aggregated_b_061325/&amp;fpr=twitter\">Use this chart</a> untuk mengawasi kapan nilai tukar pendanaan $BTC dan $ETH mulai berayun ke satu arah untuk mengidentifikasi peluang perdagangan utama.<br><a href=\"https://insights.santiment.net/?tags=btc\">Source&nbsp;</a></p>', 'posts/yiT3HuSGOK2Ua05kCNZkVlwzB7WqYxXWPWcrLbaW.png', '2025-06-14 00:25:32', '2025-06-14 00:25:32', 100, NULL),
(3, 'Ketidak pastian untuk Mengakhiri Minggu karena Para Pedagang Menunggu Perubahan Besar Bitcoin', 'ketidak-pastian-untuk-mengakhiri-minggu-karena-para-pedagang-menunggu-perubahan-besar-bitcoin', 7, '<p> Salah satu indikator swing trading teratas dalam kripto tidak ada hubungannya dengan level support &amp; resistance. Panggilan harga ritel counter trading terus-menerus membuat trader untung. Pada grafik di bawah ini:</p><p> = Total penyebutan prediksi harga Bitcoin di $30.000-$70.000</p><p> = Total penyebutan prediksi harga Bitcoin di $120.000-$160.000 Dalam 3 bulan terakhir yang ditunjukkan, Bitcoin tidak memiliki nilai pasar di bawah $70.000. Dan tentu saja tidak memiliki nilai pasar di atas $120.000 (mengingat harga tertinggi sepanjang masanya di $112.000 dari bulan lalu).</p><p>Itulah sebabnya grafik ini sangat efektif. Grafik ini mencerminkan prediksi harga yang lebih rendah vs. harga yang lebih tinggi di X, Reddit, Telegram, 4Chan, BitcoinTalk, dan Farcaster. Dan karena pasar bergerak berlawanan arah dengan arah percakapan dari ritel, panggilan ini dapat digunakan sebagai indikator tandingan yang efektif.<br><br>Sinyal jelas terbaru muncul dari tanggal 4 hingga 6 Juni, saat ritel menunjukkan kepanikan yang jelas karena $BTC jatuh ke $101K. Namun, begitu mereka mulai memprediksi seberapa rendah harga bisa jatuh, itu adalah tanda bahwa mereka sedang menjual, paus sedang mengumpulkan, dan Anda dapat membeli sendiri dengan aman. Sampai saat ini, pedagang bersikap campur aduk dan menunggu pasar mulai berayun besar sebelum memberikan reaksi emosional berikutnya.<br><br><a href=\"https://app.santiment.net/labs/trends/explore/(30K%20OR%2031K%20OR%2032K%20OR%2033K%20OR%2034K%20OR%2035K%20OR%2036K%20OR%2037K%20OR%2038K%20OR%2039K%20OR%2040K%20OR%2041K%20OR%2042K%20OR%2043K%20OR%2044K%20OR%2045K%20OR%2046K%20OR%2047K%20OR%2048K%20OR%2049K%20OR%2050K%20OR%2051K%20OR%2052K%20OR%2053K%20OR%2054K%20OR%2055K%20OR%2056K%20OR%2057K%20OR%2058K%20OR%2059K%20OR%2060K%20OR%2061K%20OR%2062K%20OR%2063K%20OR%2064K%20OR%2065K%20OR%2066K%20OR%2067K%20OR%2068K%20OR%2069K%20OR%2070K%20OR%2030000%20OR%2031000%20OR%2032000%20OR%2033000%20OR%2034000%20OR%2035000%20OR%2036000%20OR%2037000%20OR%2038000%20OR%2039000%20OR%2040000%20OR%2041000%20OR%2042000%20OR%2043000%20OR%2044000%20OR%2045000%20OR%2046000%20OR%2047000%20OR%2048000%20OR%2049000%20OR%2050000%20OR%2051000%20OR%2052000%20OR%2053000%20OR%2054000%20OR%2055000%20OR%2056000%20OR%2057000%20OR%2058000%20OR%2059000%20OR%2060000%20OR%2061000%20OR%2062000%20OR%2063000%20OR%2064000%20OR%2065000%20OR%2066000%20OR%2067000%20OR%2068000%20OR%2069000%20OR%2070000)%20AND%20(bitcoin%20OR%20btc%20OR%20$btc)?addedTopics=%28120K%2520OR%2520121K%2520OR%2520122K%2520OR%2520123K%2520OR%2520124K%2520OR%2520125K%2520OR%2520126K%2520OR%2520127K%2520OR%2520128K%2520OR%2520129K%2520OR%2520130K%2520OR%2520131K%2520OR%2520132K%2520OR%2520133K%2520OR%2520134K%2520OR%2520135K%2520OR%2520136K%2520OR%2520137K%2520OR%2520138K%2520OR%2520139K%2520OR%2520140K%2520OR%2520141K%2520OR%2520142K%2520OR%2520143K%2520OR%2520144K%2520OR%2520145K%2520OR%2520146K%2520OR%2520147K%2520OR%2520148K%2520OR%2520149K%2520OR%2520150K%2520OR%2520151K%2520OR%2520152K%2520OR%2520153K%2520OR%2520154K%2520OR%2520155K%2520OR%2520156K%2520OR%2520157K%2520OR%2520158K%2520OR%2520159K%2520OR%2520160K%2520OR%2520120000%2520OR%2520121000%2520OR%2520122000%2520OR%2520123000%2520OR%2520124000%2520OR%2520125000%2520OR%2520126000%2520OR%2520127000%2520OR%2520128000%2520OR%2520129000%2520OR%2520130000%2520OR%2520131000%2520OR%2520132000%2520OR%2520133000%2520OR%2520134000%2520OR%2520135000%2520OR%2520136000%2520OR%2520137000%2520OR%2520138000%2520OR%2520139000%2520OR%2520140000%2520OR%2520141000%2520OR%2520142000%2520OR%2520143000%2520OR%2520144000%2520OR%2520145000%2520OR%2520146000%2520OR%2520147000%2520OR%2520148000%2520OR%2520149000%2520OR%2520150000%2520OR%2520151000%2520OR%2520152000%2520OR%2520153000%2520OR%2520154000%2520OR%2520155000%2520OR%2520156000%2520OR%2520157000%2520OR%2520158000%2520OR%2520159000%2520OR%2520160000%29%2520AND%2520%28bitcoin%2520OR%2520btc%2520OR%2520%2524btc%29&amp;slug=bitcoin&amp;ticker=BTC&amp;soc_dom=1&amp;from=2025-03-13T05:00:01.000Z\">Lacak sendiri grafik ini di sini</a>, buat keputusan yang lebih tepat, dan lihat apa yang tidak dapat dilakukan orang lain di dunia kripto!<br><br><a href=\"https://insights.santiment.net/?tags=btc\">Source</a></p>', 'posts/hGa4dCRXUlVSf7cHGyE36BjjmkG3cNqmlQE6VRdU.png', '2025-06-14 00:28:21', '2025-06-14 00:28:31', 1, NULL),
(4, 'Ethereum Whale dan Sharks Semakin Menambah Jumlah Tas Mereka', 'ethereum-whale-dan-sharks-semakin-menambah-jumlah-tas-mereka', 8, '<p> Saat ini ada 6.392 dompet yang menyimpan antara 1K dan 100K Ethereum. Selama bulan lalu saja, dompet paus dan hiu utama ini telah dengan cepat menambahkan lebih banyak koin karena pedagang eceran telah mengambil untung.</p><p>Selama 30 hari terakhir ini, total +1,49 juta lebih $ETH telah diakumulasikan oleh kelompok ini, meningkatkan kepemilikan mereka sebesar +3,72%. Saat ini mereka memegang 26,98% dari seluruh pasokan aset kapitalisasi pasar kripto nomor 2.</p>', 'posts/5ha1ggfbeSn1hihKDfcq1UCuJotpQksbZRFzaYmP.png', '2025-06-14 06:30:41', '2025-06-14 06:30:41', 2, NULL),
(5, 'Chainlink dan Ethereum Melonjak karena Aktivitas Pengembangan Membawa Mereka', 'chainlink-dan-ethereum-melonjak-karena-aktivitas-pengembangan-membawa-mereka', 1, '<p> Sementara sebagian besar kripto tetap stagnan pada hari Selasa, Chainlink (+7,7%) dan Ethereum (+6,3%) terus mengalami peningkatan. Kedua proyek ini dikenal karena tim pengembangnya yang menduduki peringkat teratas. Selama 30 hari terakhir, $LINK telah menjadi acara github paling terkenal ke-2 dan $ETH berada di peringkat ke-8.</p>', 'posts/gvTSVW2E12NOSgvmGUL9fWCWQTfYh60aCKYyWIKR.png', '2025-06-14 06:37:43', '2025-06-14 06:37:43', 3, NULL),
(6, 'Ethereum Increasing its \'Total Hodlers\' Lead Over the Field', 'ethereum-increasing-its-total-hodlers-lead-over-the-field', 1, '<p> As crypto markets attempt to rally at the end of the work week, crypto networks continue to grow over time. Here are the total amount of holders for select top caps:</p><p> Ethereum $ETH: 148.38M Holders</p><p> Bitcoin $BTC: 55.39M Holders</p><p> Dogecoin $DOGE: 7.97M Holders</p><p> Tether $USDT: 7.79M Holders</p><p> XRP $XRP: 6.53M Holders</p><p> Cardano $ADA: 4.49M Holders</p><p> USD Coin $USDC: 3.30M Holders</p><p> Chainlink $LINK: 766.01K Holders</p>', 'posts/QNJVIow85WEdAEeF9ZzJoHgnz3wmllWf4PypbXCr.png', '2025-06-14 06:40:39', '2025-06-14 07:18:04', 5, NULL),
(7, 'These ETH-Based Coins are Developing Fastest Over the Past 30 Days, Worth Consideration', 'these-eth-based-coins-are-developing-fastest-over-the-past-30-days-worth-consideration', 4, '<p> Here are crypto\'s top ETH-based coins by development activity. Directional indicators represent each project\'s ranking positioning since last month:</p><p>&nbsp;</p><p>1) Chainlink $LINK </p><p> 2) Starknet $STRK </p><p> 3) Ethereum $ETH </p><p> 4) Eigenlayer $EIGEN</p><p> 5) Status $SNT</p><p> 6) sUSD $SUSD</p><p> 7) Synthetix $SNX</p><p> 8) Decentraland $MANA</p><p> 9) Lido DAO $LDO</p><p> 10) Lido Staked Ethereum $stETH </p><p>&nbsp;</p><p>Read about the <a href=\"https://medium.com/santiment/a-different-look-into-blockchain-ecosystem-development-activity-f34f32180482\">Santiment methodology</a> for filtering notable github activity data from project repositories, and why it is so useful for crypto trading!</p>', 'posts/4e6ie8lNZ6vEliowBVCVfBLpUNyj82XefsQMfoPn.png', '2025-06-14 07:08:03', '2025-06-14 07:08:03', 5, NULL);

